shellcheck is a static analysis tool that gives warnings and suggestions for scripts. You can use it online or install the tool for offline use. Given the various bash gotchas, this tool is helpful for both beginners and advanced users. $ cat bad_script.sh
#!/bin/bash greeting = 'hello world'
echo "$greeting" Here's how shellcheck reports the issue: $ shellcheck bad_script.sh In bad_script.sh line 3:
greeting = 'hello world' ^-- SC1068: Don't put spaces around the = in assignments (or quote to make it literal). For more information: https://www.shellcheck.net/wiki/SC1068 -- Don't put spaces around the = in ... info Use the -s option (-s bash for example) if your script doesn't have a shebang. info Note that shellcheck will not catch all types of issues. And suggestions should not be blindly accepted without understanding if that makes sense in the given context.
